import React, { useState, useEffect } from "react";
import { useDispatch } from "react-redux";
//import { Formik,Form } from "formik";
import { View, Text, StyleSheet, TextInput, Button,Image,Ul,li } from "react-native";
import { login } from "./../../actions/auth";

import { Checkbox,ConfigProvider  } from "antd"
import axios from "axios";


//import DatePicker from 'react-native-datepicker';
import dayjs from 'dayjs';
import { Formik, Field, Form,useFormikContext,useField} from "formik";

import styles from "../../constant/GlobalStyles";
import Colors from "../../constant/color";
import globalconst from '../../constant/globalvariables';

import CustomInput from "../../customComponent/CustomInput"
import { useCookies } from 'react-cookie';

import * as yup from 'yup';
import { getParagraph, initialize } from "../../actions/fetch";



const Faq = () => {





return (
  <View style={styles.loginContainer}> 
  <View style={{flex:2,backgroundColor:Colors.HomeColor}}>
      <View style={{flexDirection:'column'}}>
      <Image style={styles.logo} source={require("../../assets/iiitnew.png")} />
          <br/>
          <View style={{width:'80%',alignSelf:'center'}}>
             <center> <Text style={styles.loginHeaderText}>FAQ's</Text></center>


              <View>
                <Text>
                How can I contribute?
                </Text>
                <br/>
                <Text>
                Register on our website <Text onPress={()=>redirectToHomePage()}>Bhaashadan</Text>
                </Text>
                <Text>
                Choose a language - Assamese, Bangla, Gujarati, Hindi, Kannada, Malayalam, Manipuri, Marathi, Odia, Punjabi, Tamil, Telugu and Urdu.
                </Text>
                <Text>
                Handwrite the document provided and upload a good quality photograph of the handwritten document.
                </Text>

              </View>



          </View>
      </View>
 </View>



</View>
)
}
const  CheckboxField =({ ...props }) => {
const { setFieldValue } = useFormikContext();
const [field] = useField(props);

return (
  <ConfigProvider
  theme={{
    token: {
      colorPrimary: Colors.LoginBorderColor,
      colorBorder: Colors.LoginBorderColor,
      paddingXS:2,
      marginXS:2,
      fontSize:20,
    },
  }}
>
  <Checkbox
    {...field}
    {...props}
    onClick={val=>setFieldValue(field.name,val)}
  />
  </ConfigProvider>
);
};

function handleForgotPassword(){

}
function handleRegister(props){
 // alert(JSON.stringify(props));
props.navigation.navigate('Register',{"isCreate":true});
}
function redirectToHomePage(){
  props.navigation.navigate('Home');
}
export default Faq;
